import React from 'react';
import Recruit from './components/Recruits/Recruits'
import Navbar from './components/Sidebar'
import './styles/App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Navbar />
        <Recruit />
      </header>
    </div>
  );
}

export default App;
